const Header = () => {
    return (
        <div className="header">
            <div className="header-left">
                <h3>Hello Son, Welcome back</h3>
                <h1>Your Assignment Dashboard</h1>
            </div>
            <div className="header-right">
                <img src="../../../public/images/gear-solid.svg" alt="setting icon" color="#fff"></img>
                <img src="../../../public/images/bell-solid.svg" alt="bell icon" color="#fff"></img>
            </div>
        </div>
    )
}
export default Header;
